import React from 'react';
import Recipe from './Recipe';

class App extends React.Component {
  render() {
    return (
      <div>
        <h1>レシピ一覧</h1>
        <div className='recipe'>
          <Recipe
          name='レシピ１'
          image="../public/logo.192.png"
          />
          <Recipe
          name='レシピ２'
          image="../public/logo512.png"
          />
          <Recipe
          name='レシピ３'
          image="./logo192.png"
          />
        </div>
      </div>
    );
  }
}

export default App;
